import React from 'react';
import 'https://www.w3schools.com/w3css/4/w3.css'
import 'https://fonts.googleapis.com/css?family=Raleway'
import Background from 'https://c.wallhere.com/photos/e5/14/show_street_camera_new_leica_city_nyc_trip-902282.jpg!d'

const bgStyle = {
	backgroundImage: `url(${Background})`
}
const LandingPage = () => (
<div style={bgStyle} className=" w3-display-container w3-animate-opacity w3-text-white">
    <div class="w3-display-middle">
        <a href="/"><h1 className="w3-jumbo w3-button w3-display-middle" href="/">SIGFOX</h1></a>
    </div>
  <div class="w3-display-bottomleft w3-padding-large">
    Powered by <a href="http://cat.hfu.edu.tw/~b8303002/" target="_blank">Brocere</a>
  </div>
</div>
);
export default LandingPage;
